column2:
将棋は右手系(の回転)。
囲碁は左手系。

将棋と囲碁のマス目の中に置くか交点に置くかの違いも数学空間で定式化できるかも(格子点？)
&lt;/座標平面の特殊化終了&gt;
&lt;/論点1終了&gt;

今思い出したけど、中学の時に
if (not (A and B)) {
…
}
は
if (not A or not B) {
…
}
に等しいと自身で発見してたかも(ド・モルガンの法則)。忘れちゃってた

